import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import './taskform.css';

function TaskForm({ category, useCreateOrderWithTask = false }) { // New prop added
    const [taskName, setTaskName] = useState('');
    const [taskDetails, setTaskDetails] = useState('');
    const [startDate, setStartDate] = useState('');
    const [endDate, setEndDate] = useState('');
    const [priceFrom, setPriceFrom] = useState('');
    const [priceTo, setPriceTo] = useState('');
    const [isModalOpen, setIsModalOpen] = useState(false);

    const navigate = useNavigate();
    const userId = sessionStorage.getItem('userId');

    const handleSubmit = async (event) => {
        event.preventDefault();
        try {
            const endpoint = useCreateOrderWithTask ? 'http://localhost:8080/order/create-with-task' : 'http://localhost:8080/task/create';
            const data = {
                userId,
                taskName,
                taskDetails,
                startDate,
                endDate,
                priceFrom,
                priceTo,
                category
            };
            if (useCreateOrderWithTask) {
                data.serviceId = someServiceId; // Set serviceId appropriately
            }

            const response = await axios.post(endpoint, data, {
                headers: {
                    'Content-Type': 'application/json'
                }
            });

            console.log('Request successful:', response.data);
            setIsModalOpen(true);
        } catch (error) {
            console.error('Error creating task or order with task:', error);
        }
    };

    const handleModalClose = () => {
        setIsModalOpen(false);
        navigate('/catalog');
    };

    return (
        <main className="main">
            <div className="task-form-container">
                <h1>Что конкретно нужно сделать?</h1>
                <form onSubmit={handleSubmit}>
                    <input
                        type="text"
                        placeholder="Короткое название задачи"
                        value={taskName}
                        onChange={(e) => setTaskName(e.target.value)}
                    />
                    <textarea
                        placeholder="Расскажите подробнее про задачу"
                        value={taskDetails}
                        onChange={(e) => setTaskDetails(e.target.value)}
                    />
                    <div className="date-range">
                        <p>Укажите сроки</p>
                        <div className="sroki">
                            <input
                                type="date"
                                placeholder="Дата начала"
                                value={startDate}
                                onChange={(e) => setStartDate(e.target.value)}
                            />
                            <input
                                type="date"
                                placeholder="Дата конца"
                                value={endDate}
                                onChange={(e) => setEndDate(e.target.value)}
                            />
                        </div>
                    </div>
                    <div className="price-range">
                        <p>Укажите ценовой диапазон</p>
                        <div className="prices">
                            <input
                                type="number"
                                placeholder="от"
                                value={priceFrom}
                                onChange={(e) => setPriceFrom(e.target.value)}
                            />
                            <input
                                type="number"
                                placeholder="до"
                                value={priceTo}
                                onChange={(e) => setPriceTo(e.target.value)}
                            />
                        </div>
                    </div>
                    <button type="submit">Предложить заказ</button>
                </form>
                {isModalOpen && (
                    <div className="modal">
                        <div className="modal-content">
                            <p>Заказчик рассмотрит ваше предложение</p>
                            <button onClick={handleModalClose}>ОК</button>
                        </div>
                    </div>
                )}
            </div>
        </main>
    );
}

export default TaskForm;
